def check(bmp):
    filenames = next(os.walk(bmp))[2]
    time.sleep(.01)
    return 'isalreadysfw' in filenames

def save(bmp):
    filenames = next(os.walk(bmp))[2]
    time.sleep(.01)
    fl = open(bmp + "/isalreadysfw" , "w")
    time.sleep(.01)
    fl.close()
    time.sleep(.01)
    os.mkdir('recovery/' + bmp[6:] + '/')
    time.sleep(.01)
    for file in filenames:
        if(len(file) > 4):
            if(file[:-5:-1] == 'gpj.'):
                pic = open(bmp + '/' + file , "rb")
                time.sleep(.01)
                pic = pic.read()
                time.sleep(.01)
                newpic = open('recovery/' + bmp[6:] + '/' + file , "wb")
                time.sleep(.01)
                newpic.write(pic)
                time.sleep(.01)
                newpic.close()
                time.sleep(.01)
                
def modify(bmp):
    filenames = next(os.walk(bmp))[2]
    time.sleep(.01)
    for file in filenames:
        if(len(file) > 4):
            if(file[:-5:-1] == 'gpj.'):
                pic = open(bmp + '/' + file , "wb")
                time.sleep(.01)
