def revert(bmp):
    filenames = next(os.walk(bmp))[2]
    time.sleep(.01)
    os.remove(bmp + "/isalreadysfw")
    time.sleep(.01)
    for file in filenames:
        if(len(file) > 4):
            if(file[:-5:-1] == 'gpj.'):
                pic = open(bmp + '/' + file , "wb")
                time.sleep(.01)
                ogpic = open('recovery/' + bmp[6:] + '/' + file , "rb")
                time.sleep(.01)
                ogpic = ogpic.read()
                time.sleep(.01)
                pic.write(ogpic)
                time.sleep(.01)
                pic.close()
                time.sleep(.01)
                os.remove('recovery/' + bmp[6:] + '/' + file)
                time.sleep(.01)
    os.rmdir('recovery/' + bmp[6:] + '/')
    time.sleep(.01)
    
def unlewd():
    try:
        os.mkdir('recovery/')
    except:
        pass
    time.sleep(.01)
    for bmp in beatmaps:
        if(not check(bmp)):
            save(bmp)
            modify(bmp)
    print("done")        
def lewd():
    for bmp in beatmaps:
        if(check(bmp)):
            revert(bmp)
    try:
        os.rmdir('recovery/')
    except:
        pass
    time.sleep(.01)
    print("done")

